// import './Header.css'
import GlobalNav from './GlobalNav'
function Header() {
    return (
        <header className="header">
            <img src="http://placekitten.com/100/100?image=1" className="header-logo" alt="logo" />
            <h1 className="header-title">Header Title</h1>
            <GlobalNav></GlobalNav>
        </header>
    )
}
export default Header
